import React from 'react'

import Banner from '../components/Banner'

const styles = {
    container: {
        width: '100vw',
        height: '100vh',
        position: 'relative',
        backgroundColor: '#eee'
    }
}

const Index = () => (
    <section style = { styles.container }>
        <Banner />
    </section>
)

export default Index
